function Valve({ valveId, status, toggleValve }) {
    const imagePath = `${process.env.PUBLIC_URL}/path/to/image/valve-icon-${status}.png`;

    return (
      <div 
        onClick={() => toggleValve(valveId)} 
        style={{ cursor: 'pointer' }}
        title={`${valveId} - ${status}`}
      >
        <img src={imagePath} alt={`${valveId} - ${status}`} />
      </div>
    );
  }

  export default Valve;
